import React from "react";
import { Link } from "react-router-dom";

const Menu = () => {
  return (
    <nav className="navbar ">
      <Link to="/" className="navbar-brand">
        || HOME |
      </Link>
      <Link to="/About" className=" nav-link active">
        || ABOUT |
      </Link>
      <Link to="/Login&Register">|| LOGIN |</Link>
    </nav>
  );
};

export default Menu;
